import './AdminPanel.css'
import Topbar from '../Topbar/Topbar'
import Sidebar from "../Sidebar/Sidebar";
import {Link} from "react-router-dom";
import React from "react";
import VacanciesView from "../VacanciesView/VacanciesView";
import {useState} from "react";

export default function  AdminPanel() {
const [isOpen,setIsOpen]=useState(false)
    setIsOpen(true)
       return (

           <div className="admin-panel">
               <Topbar />
               <div className="content">
                   <Sidebar />
                   <div className="main-content">
                       <div className='adminDiv'>
                           {!isOpen ? <VacanciesView/>:''}
                           <div className="tiles-container">
                               <div className="tile">
                                   {isOpen ? <Link to='/VacanciesView' className='linkReports'>Вакансии</Link>:''}
                               </div>
                               <div className="tile">
                                   <Link to='/VacanciesView' className='linkReports'>Назначить роль</Link>
                               </div>
                               <div className="tile">
                                   <Link to='/VacanciesView' className='linkReports'>Функционал1</Link>
                               </div>
                           </div>
                       </div>
                   </div>
               </div>
           </div>
    )
}
